import {useState} from 'react';
import {useForm} from 'react-hook-form';
import React from 'react';
import {Body} from './FormStyles';

const Form= ()=> {
    const {register, handleSubmit} = useForm();
    const [result, setResult] = useState('');
    const onSubmit = (data) => setResult(JSON.stringify(data));
    return(
        <Body>
            <h1 style={{color: 'white', textAlign: "center"}}>Επικοινωνήστε μαζί μας</h1>
            <form onSubmit={handleSubmit(onSubmit)}>
                <input {...register('firstName')} placeholder= 'Όνομα'/>
                <input {...register('lastName')} placeholder= 'Επώνυμο'/>
                <select {...register('category')}>
                    <option value=''>Select...</option>
                    <option value='A'>Επιλογή Α</option>
                    <option value= 'B'>Επιλογή Β</option>
                </select>

                <p>{result}</p>
                <input type='submit'/>
            </form>
        </Body>
    )
}
export default Form;
